import React, { useState, useEffect } from 'react';
import { 
  Calendar, 
  Activity,
  Database,
  FileText,
  TrendingUp,
  Download,
  Settings,
  BarChart3,
  FileSpreadsheet,
  Target,
  CalendarRange,
  History,
  CheckCircle,
  Zap,
  RefreshCw
} from 'lucide-react';

interface DateProcessingStatus {
  cleaned_count: number;
  processed_count: number;
  pending_count: number;
  date_statistics: {
    total_docs: number;
    docs_with_promulgation: number;
    docs_with_general_date: number;
    docs_with_both_dates: number;
    pre_1947_count: number;
    ordinance_count: number;
  };
}

interface ProgressData {
  processed: number;
  total: number;
  successful: number;
  failed: number;
  current_doc: string;
  promulgation_date: string | null;
  general_date: string | null;
}

const Phase4Dashboard: React.FC = () => {
  const [status, setStatus] = useState<DateProcessingStatus | null>(null);
  const [isProcessing, setIsProcessing] = useState<boolean>(false);
  const [previewData, setPreviewData] = useState<any>(null);
  const [fieldAnalysis, setFieldAnalysis] = useState<any>(null);
  const [progressData, setProgressData] = useState<ProgressData | null>(null);
  const [processingLog, setProcessingLog] = useState<any[]>([]);
  const [configuration, setConfiguration] = useState<any>(null);
  const [activeTab, setActiveTab] = useState<string>('overview');

  useEffect(() => {
    fetchStatus();
    fetchPreview();
    fetchFieldAnalysis();
    fetchProcessingLog();
    fetchConfiguration();
  }, []);

  useEffect(() => {
    if (isProcessing) {
      const eventSource = new EventSource('/api/v1/phase4/progress-stream');
      eventSource.onmessage = (event) => {
        const data = JSON.parse(event.data);
        setProgressData(data);
        if (data.processed === data.total) {
          setIsProcessing(false);
          eventSource.close();
          fetchStatus();
          fetchPreview();
          fetchFieldAnalysis();
          fetchProcessingLog();
        }
      };
      return () => eventSource.close();
    }
  }, [isProcessing]);

  const fetchStatus = async () => {
    try {
      const res = await fetch('/api/v1/phase4/status');
      const data = await res.json();
      if (data.success) setStatus(data);
    } catch (e) {
      console.error(e);
    }
  };

  const fetchPreview = async () => {
    try {
      const res = await fetch('/api/v1/phase4/preview');
      const data = await res.json();
      if (data.success) setPreviewData(data);
    } catch (e) { console.error(e); }
  };

  const fetchFieldAnalysis = async () => {
    try {
      const res = await fetch('/api/v1/phase4/field-analysis');
      const data = await res.json();
      if (data.success) setFieldAnalysis(data);
    } catch (e) { console.error(e); }
  };

  const fetchProcessingLog = async () => {
    try {
      const res = await fetch('/api/v1/phase4/processing-log');
      const data = await res.json();
      if (data.success) setProcessingLog(data.log_entries || []);
    } catch (e) { console.error(e); }
  };

  const fetchConfiguration = async () => {
    try {
      const res = await fetch('/api/v1/phase4/configuration');
      const data = await res.json();
      if (data.success) setConfiguration(data.configuration);
    } catch (e) { console.error(e); }
  };

  const startDateProcessing = async () => {
    setIsProcessing(true);
    setProgressData(null);
    try {
      const res = await fetch('/api/v1/phase4/start-processing', { method: 'POST' });
      const result = await res.json();
      if (!result.success) {
        alert('Failed to start processing');
        setIsProcessing(false);
      }
    } catch (e) { console.error(e); setIsProcessing(false); }
  };

  const exportFile = async (path: string, filenamePrefix: string) => {
    try {
      const res = await fetch(path);
      const blob = await res.blob();
      const url = window.URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.href = url;
      a.download = `${filenamePrefix}_${new Date().toISOString().slice(0,19).replace(/:/g,'-')}.xlsx`;
      document.body.appendChild(a);
      a.click();
      window.URL.revokeObjectURL(url);
      document.body.removeChild(a);
    } catch (e) { console.error(e); alert('Export failed'); }
  };

  if (!status) return <div className="p-6">Loading...</div>;

  return (
    <div className="p-6 space-y-6">
      <div className="border-b pb-4">
        <h1 className="text-3xl font-bold">Phase 4: Enhanced Date Processing</h1>
        <p className="text-gray-600 mt-2">AI-powered date extraction with immediate field insertion and exports</p>
      </div>

      <div className="border-b border-gray-200">
        <nav className="-mb-px flex space-x-8">
          {[{id:'overview', name:'Overview', icon:BarChart3},{id:'processing', name:'Processing', icon:Activity},{id:'analysis', name:'Analysis', icon:TrendingUp},{id:'exports', name:'Exports', icon:Download},{id:'configuration', name:'Configuration', icon:Settings},{id:'logs', name:'Logs', icon:FileText}].map(tab => {
            const Icon = (tab as any).icon;
            return (
              <button key={tab.id} onClick={() => setActiveTab(tab.id)} className={`py-2 px-1 border-b-2 font-medium text-sm flex items-center ${activeTab===tab.id?'border-blue-500 text-blue-600':'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'}`}>
                <Icon className="h-4 w-4 mr-2" />
                {tab.name}
              </button>
            );
          })}
        </nav>
      </div>

      {/* Simplified overview */}
      {activeTab === 'overview' && (
        <div className="space-y-6">
          <div className="grid grid-cols-1 md:grid-cols-4 gap-6">
            <div className="bg-blue-50 p-6 rounded-lg border border-blue-200">
              <div className="flex items-center">
                <Database className="h-8 w-8 text-blue-600" />
                <div className="ml-4">
                  <p className="text-sm font-medium text-blue-600">Cleaned</p>
                  <p className="text-2xl font-bold text-blue-900">{status.cleaned_count}</p>
                </div>
              </div>
            </div>

            <div className="bg-green-50 p-6 rounded-lg border border-green-200">
              <div className="flex items-center">
                <Calendar className="h-8 w-8 text-green-600" />
                <div className="ml-4">
                  <p className="text-sm font-medium text-green-600">Processed</p>
                  <p className="text-2xl font-bold text-green-900">{status.processed_count}</p>
                </div>
              </div>
            </div>

            <div className="bg-purple-50 p-6 rounded-lg border border-purple-200">
              <div className="flex items-center">
                <Target className="h-8 w-8 text-purple-600" />
                <div className="ml-4">
                  <p className="text-sm font-medium text-purple-600">Promulgation Dates</p>
                  <p className="text-2xl font-bold text-purple-900">{status.date_statistics.docs_with_promulgation}</p>
                </div>
              </div>
            </div>

            <div className="bg-orange-50 p-6 rounded-lg border border-orange-200">
              <div className="flex items-center">
                <CalendarRange className="h-8 w-8 text-orange-600" />
                <div className="ml-4">
                  <p className="text-sm font-medium text-orange-600">General Dates</p>
                  <p className="text-2xl font-bold text-orange-900">{status.date_statistics.docs_with_general_date}</p>
                </div>
              </div>
            </div>
          </div>

          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            <div className="bg-yellow-50 p-6 rounded-lg border border-yellow-200">
              <div className="flex items-center">
                <History className="h-8 w-8 text-yellow-600" />
                <div className="ml-4">
                  <p className="text-sm font-medium text-yellow-600">Pre-1947</p>
                  <p className="text-2xl font-bold text-yellow-900">{status.date_statistics.pre_1947_count}</p>
                </div>
              </div>
            </div>

            <div className="bg-red-50 p-6 rounded-lg border border-red-200">
              <div className="flex items-center">
                <FileSpreadsheet className="h-8 w-8 text-red-600" />
                <div className="ml-4">
                  <p className="text-sm font-medium text-red-600">Ordinances</p>
                  <p className="text-2xl font-bold text-red-900">{status.date_statistics.ordinance_count}</p>
                </div>
              </div>
            </div>

            <div className="bg-indigo-50 p-6 rounded-lg border border-indigo-200">
              <div className="flex items-center">
                <CheckCircle className="h-8 w-8 text-indigo-600" />
                <div className="ml-4">
                  <p className="text-sm font-medium text-indigo-600">Both Dates</p>
                  <p className="text-2xl font-bold text-indigo-900">{status.date_statistics.docs_with_both_dates}</p>
                </div>
              </div>
            </div>
          </div>
        </div>
      )}

      {/* Processing tab simplified */}
      {activeTab === 'processing' && (
        <div className="space-y-6">
          <div className="bg-white p-6 rounded-lg border shadow-sm">
            <div className="flex items-center justify-between">
              <div>
                <h3 className="text-lg font-semibold">Enhanced Date Processing</h3>
                <p className="text-gray-600 mt-1">Immediate insertion and monitoring</p>
              </div>
              <div className="flex space-x-3">
                <button onClick={startDateProcessing} disabled={isProcessing || status.pending_count===0} className="bg-blue-600 text-white px-6 py-3 rounded-lg font-medium flex items-center">
                  {isProcessing ? (<><Activity className="h-5 w-5 mr-2 animate-spin"/> Processing...</>) : (<><Zap className="h-5 w-5 mr-2"/> Start Processing</>)}
                </button>
                <button onClick={() => { fetchConfiguration(); alert('Cache cleared (placeholder)'); }} className="bg-gray-600 text-white px-4 py-3 rounded-lg"> <RefreshCw className="h-5 w-5 mr-2"/> Clear Cache</button>
              </div>
            </div>

            {isProcessing && progressData && (
              <div className="mt-4 p-4 bg-blue-50 rounded-lg">
                <div className="flex items-center text-blue-800">
                  <Activity className="h-5 w-5 mr-2 animate-spin" />
                  <span>Processing in progress...</span>
                </div>
              </div>
            )}
          </div>

          {isProcessing && progressData && (
            <div className="bg-white p-6 rounded-lg border shadow-sm">
              <h3 className="text-lg font-semibold">Real-time Processing Progress</h3>
              <div className="w-full bg-gray-200 rounded-full h-4 mt-4">
                <div className="bg-blue-600 h-4 rounded-full" style={{ width: `${(progressData.processed / progressData.total) * 100}%` }} />
              </div>
            </div>
          )}
        </div>
      )}

      {activeTab === 'exports' && (
        <div className="space-y-6">
          <div className="bg-white p-6 rounded-lg border shadow-sm">
            <h3 className="text-lg font-semibold">Excel Export Options</h3>
            <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mt-4">
              <div className="border rounded-lg p-4">
                <h4 className="font-medium">Date Records</h4>
                <p className="text-sm text-gray-600">Complete export of all extracted dates</p>
                <button onClick={() => exportFile('/api/v1/phase4/export-date-records','date_records')} className="w-full bg-green-600 text-white px-4 py-2 rounded-lg mt-3">Export</button>
              </div>
              <div className="border rounded-lg p-4">
                <h4 className="font-medium">Missing Dates</h4>
                <p className="text-sm text-gray-600">Documents without extracted dates</p>
                <button onClick={() => exportFile('/api/v1/phase4/export-missing-dates','missing_dates')} className="w-full bg-red-600 text-white px-4 py-2 rounded-lg mt-3">Export</button>
              </div>
              <div className="border rounded-lg p-4">
                <h4 className="font-medium">Analysis Report</h4>
                <p className="text-sm text-gray-600">Summary and distribution</p>
                <button onClick={() => exportFile('/api/v1/phase4/export-analysis-report','analysis_report')} className="w-full bg-blue-600 text-white px-4 py-2 rounded-lg mt-3">Export</button>
              </div>
            </div>
          </div>
        </div>
      )}

      {activeTab === 'logs' && (
        <div className="space-y-6">
          <div className="bg-white p-6 rounded-lg border shadow-sm">
            <h3 className="text-lg font-semibold">Processing Log</h3>
            {processingLog.length > 0 ? (
              <div className="space-y-2 max-h-96 overflow-y-auto mt-4">
                {processingLog.slice(-50).reverse().map((log, idx) => (
                  <div key={idx} className={`flex items-center p-3 rounded-lg ${log.status === 'success' ? 'bg-green-50' : 'bg-gray-50'}`}>
                    <div className="flex-1">
                      <div className="flex items-center justify-between">
                        <p className="text-sm font-medium">Document {log.document_id}</p>
                        <span className="text-xs px-2 py-1 rounded bg-gray-200">{log.status}</span>
                      </div>
                      <p className="text-xs text-gray-500">{new Date(log.timestamp).toLocaleString()}</p>
                    </div>
                  </div>
                ))}
              </div>
            ) : (
              <div className="text-center py-8 text-gray-500">No processing logs yet.</div>
            )}
          </div>
        </div>
      )}

    </div>
  );
};

export default Phase4Dashboard;
